import React from 'react';
import {Link} from '../routes';

const Headers =()=>{
   return <div class="ui menu" style={{marginTop:'20px'}}>
  <link route='/'><a class="item">CrowdCoins</a></link> 
  
  <div class="right menu">
  <link route='/'> <a class="item">Campaigns</a></link>
  <link route='/Campaigns/create'><a class="item">+</a></link>  
  </div>
</div>
}
export default Headers;
